import React from "react";
import Table from "./Table";

export default function MainWindow(props) {
  const title = props.title,
    items = props.items

  return (
    <section>
      <h2>{title}</h2>
      {items
        ? items.map((item, key) => (
            <Table
              item={item}
              key={key}

              like={(like_data) => {
               
                props.like(like_data);
              }}
            />

          ))
        : console.log("loading")}
    </section>
  );
}
